window.bookSummaryJSON = "<p>Have you ever wished that you could be the boss for once? Are you tired of being the submissive mousy type whom no one respects? Are you sick of taking orders, instead of giving them? Then clearly you are ready to become more dominant. And you have come to the right audiobook to find out how to unlock your dominant traits and become an alpha person.</p> <p>Alpha people are the ones who turn heads. They command respect wherever they go. They have no problem giving orders, and people scramble to please them. I bet you know an alpha person or two. But now, you get to be an alpha person! Can you imagine how great that will feel?</p> <p>This audiobook has all of the secrets that alpha people already know. Now, these secrets will be yours! Just listen to this guide to become an alpha person. You will learn all about how to impress other people with your appearance, language, and posture. You will learn how to give orders and how to influence people, both covertly and overtly. Finally, you will learn about how to gain dominance in relationships that you already have established, and how to maintain that dominance once you finally gain it.</p> <p>It is time to stop being mousy. Stop being the underling and the subordinate. Instead, become an alpha person who is on top and who is giving orders. Learn how to make people respect you and follow your lead. Your life will change exponentially when you become an alpha.</p>"; 
